import React, {Component} from 'react';
// import axios from 'axios';
import {
    withRouter
  } from 'react-router-dom'
class Historylist extends Component {
  constructor(props) {
    console.log('in History List!')
    super(props);
    console.log('this.props.locations,',this.props.locations)
    this.state = {
       locations:this.props.locations,
       top:this.props.locations.length
    }

  }

  top = e =>{
    var num = e.target.value;
    console.log('num,',num)
    console.log('type,',typeof num)
    if(Number.isInteger(num)){
      if(num<=0){
        alert('Integer must larger than 0')
      }else{
        this.setState({top:num})
      }
    }else{
      alert('Please input integer') 
    }
  }

  render() {
    console.log("in history render!!!")
    console.log("top,",this.state.top)
    var section = null;

    section = this.state.locations && this.state.locations.map((next,i) => {
      return (
        <li key={i}>
          {i+1}. Ip Address: {next.ip} 
        </li>
        )
    })
    return(
        <div className='historylist'>
          <input type="text" id="myInput" value={this.state.top} onChange={this.top} placeholder="Search for top N..."></input>
          <ol>
          {section} 
          </ol>

        </div>


    )
  }
}

export default withRouter(Historylist);
